import React from "react";
import {
    CssClasses
} 
from "../../utilities";

const container = props => {
    const classes = new CssClasses("container", "bg-dark");
    
    const a = {...props};

    if (props.fluid) {
        classes.concatStringToClass("container", "fluid")
    }

    return (
        <div className={classes.toString()}>
            {props.children}
        </div>
    );
};

export default container;
